import React, { useEffect } from "react";
import "./home.css";
import AOS from "aos";
import "aos/dist/aos.css";

const Vision = () => {
  useEffect(() => {
    AOS.init({ duration: 1000, once: true }); // Initialize AOS
  }, []);

  return (
    <div>
      {/* Company Vision */}
      <div
        className="container3"
        style={{
          backgroundImage: "url('/images/bg2.png')",
        }}
      >
        {/* Overlay Text */}
        <div className="text-overlay1" data-aos="fade-up">
          <h1>Our Vision</h1>
          <h4>
            <img
              src="/images/i1.png"
              alt="icon"
              style={{ width: "50px", height: "50px", marginRight: "10px", verticalAlign: "middle" }}
            />
            We aim to revolutionize the industry by providing cutting-edge solutions and sustainable growth.
            <p>
            In the era of dual carbon goals, Aofei New Energy adheres to the principles of high standards, high quality, and high returns in its cooperative approach.
            </p>
          </h4>
          <p>
            <img
              src="/images/i2.png"
              alt="icon"
              style={{ width: "50px", height: "50px", marginRight: "10px", verticalAlign: "middle" }}
            />
            We aim to revolutionize the industry by providing cutting-edge solutions and sustainable growth.
          </p>
          <p>
            <img
              src="/images/i3.png"
              alt="icon"
              style={{ width: "50px", height: "50px", marginRight: "10px", verticalAlign: "middle" }}
            />
            We aim to revolutionize the industry by providing cutting-edge solutions and sustainable growth.
          </p>
        </div>
      </div>
    </div>
  );
};

export default Vision;
